import React, { useState, useEffect } from "react";
import {
  Container,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
} from "reactstrap";
import axios from "axios";

const Registrar = () => {
  const [id, setId] = useState("");
  const [nombre, setNombre] = useState("");
  const [login, setLogin] = useState("");
  const [password, setPassword] = useState("");

  const onChangeHandler = (event) => {
    if (event.name === "login") {
      setLogin(event.value);
    } else {
      setPassword(event.value);
    }
  };

  return (
    <Form>
      <h1>Registrar</h1>
      <FormGroup>
        <Label for="exampleEmail">Email</Label>
        <Input
          type="text"
          name="login"
          id="login"
          placeholder="JohnDoe"
          value={login}
          onChange={(e) => onChangeHandler(e.currentTarget)}
        />
      </FormGroup>
      <FormGroup>
        <Label for="exampleId">Id</Label>
        <Input
          type="password"
          name="id"
          id="ID"
          placeholder="ID"
          value={id}
          onChange={(e) => onChangeHandler(e.currentTarget)}
        />
      </FormGroup>
      <FormGroup>
        <Label for="exampleNombre">Nombre</Label>
        <Input
          type="password"
          name="nombre"
          id="Password"
          placeholder="Nombre"
          value={nombre}
          onChange={(e) => onChangeHandler(e.currentTarget)}
        />
      </FormGroup>
      <FormGroup>
        <Label for="exampleLogin">Login</Label>
        <Input
          type="text"
          name="login"
          id="login"
          placeholder="Login"
          value={login}
          onChange={(e) => onChangeHandler(e.currentTarget)}
        />
      </FormGroup>
      <FormGroup>
        <Label for="examplePassword">Password</Label>
        <Input
          type="password"
          name="password"
          id="Password"
          placeholder="aaaaa"
          value={password}
          onChange={(e) => onChangeHandler(e.currentTarget)}
        />
      </FormGroup>
    </Form>
  );
};

export default Registrar;
